{ entry = 43628,  name = "Arthas, my love, please come back to me." },
{ entry = 43629,  name = "Young Arthas must learn patience to temper his power. I will pray that he one day learns how to lead with care rather than force." },
{ entry = 43630,  name = "It is my wish that my dear Taelan will grow strong enough to defend the people he cares for." },
{ entry = 43631,  name = "Wishes are a fool's pastime. Take this coin as payment for your precious Eye." },
{ entry = 43632,  name = "I hope my sisters and I can grow up and get married together. This coin appears to be very old." },
{ entry = 43633,  name = "That young apprentice Jaina is quite attractive for a human. I hope she recognizes my elegance and power." },
{ entry = 43634,  name = "Listen, little wishing fountain. You'll give me all your power if you know what's good for you." },
{ entry = 43635,  name = "Sometimes... I wish someone would come along and just give me a big, long hug." },
{ entry = 43636,  name = "Just once, I wish someone would greet me without making a stupid joke about gnomes or time travel." },
{ entry = 43637,  name = "Brann Bronzebeard was here." },
{ entry = 43638,  name = "I wish someday to retire to my own tidy little estate, with a bunch of pet dogs to keep me company." },
{ entry = 43639,  name = "Already, I've a kingdom in my prospects, a land to rule. What to ask for?  Perhaps a frozen scone..." },
{ entry = 43640,  name = "I wish to know how you survived my wrath, little fountain." },
{ entry = 43641,  name = "I wish I would grow up, it feels like I've been 10 for years. " },
{ entry = 43643,  name = "I hope that my father and brothers outlive me. I'll not make much of a king." },
{ entry = 43644,  name = "I'm so forgetful! I wish I had a better memory. Wait, didn't I already throw a coin into here?" },
