{ entry = 43674,  name = "While it appears this glyph was burned horribly and no longer contains any magic, a vendor might not know the difference..." },
{ entry = 43675,  name = "The War of the Shifting Sands... I wish I could forget it ever happened." },
{ entry = 43676,  name = "Oh, why won't you notice me? Abbendis, I would follow you anywhere. I wish you would notice me..." },
{ entry = 43677,  name = "How does this fountain even work? I wonder if I could make one." },
{ entry = 43678,  name = "Grant me the strength to accept the things that I cannot change, the courage to change the things I can and the wisdom to know the difference." },
{ entry = 43679,  name = "May the Holy Light protect us on our expedition to the frozen north. " },
{ entry = 43680,  name = "I wish the uprising back at home would settle itself soon. I wouldn't want anyone to be hurt." },
{ entry = 43681,  name = "May my son Arthas always act in the best interest of his people." },
{ entry = 43682,  name = "I hope young Kael'thas realizes that one day he must lead our people." },
{ entry = 43683,  name = "Turalyon and Alleria, wherever you are, may you be well." },
{ entry = 43684,  name = "<You sense the ringing of three tones in your head, the third barely audible under the others' din.>" },
{ entry = 43685,  name = "Where's Illidan?" },
{ entry = 43686,  name = "May my sisters realize their full potential, the name Windrunner known as result of their deeds." },
{ entry = 43687,  name = "I really wish you mages would get your heads out from inside your own... books." },
{ entry = 43688,  name = "Weeping Quarry Document" },
{ entry = 43689,  name = "Weeping Quarry Ledger" },
{ entry = 43690,  name = "Weeping Quarry Schedule" },
{ entry = 43691,  name = "Weeping Quarry Map" },
{ entry = 43693,  name = "Hard to believe that this is all that is left of the once mighty rhino god." },
{ entry = 43694,  name = "Looks like falling in the soup pot did not work out so well this time." },
{ entry = 43695,  name = "Also useful for removing paint." },
{ entry = 43696,  name = "Also useful for removing paint." },
{ entry = 43697,  name = "What strange construction. It must be one of the most alien-looking objects you've ever seen." },
{ entry = 43698,  name = "Teaches you how to summon this companion." },
{ entry = 43699,  name = "There's information on this thing? What? There's no writing!" },
{ entry = 43701,  name = "Wish I had that cousin of mine's duty to do nothing more than lug wood around carelessly..." },
{ entry = 43702,  name = "One day, I hope to spread the path of the Light to the common people and teach them the value of the Three Virtues." },
{ entry = 43703,  name = "I wish for happiness and acceptance for my daughter. She feels so out of place here..." },
{ entry = 43704,  name = "Can I have a more comfortable saddle?  My hindquarters ache." },
{ entry = 43705,  name = "I hope a troll dies, right... NOW." },
{ entry = 43706,  name = "I wish that that jerk Arthas would fall into a pile of magnataur doody!" },
{ entry = 43707,  name = "May Tirion's quest here in Northrend end with success, or may he die honorably in battle." },
{ entry = 43708,  name = "Being a rogue is hard work.  Someday I hope to pursue my life's one true passion..." },
{ entry = 43709,  name = "I hope I end up in another book eventually." },
{ entry = 43710,  name = "Pah, the fountains in Gilneas could grant ten times as many wishes as Dalaran's!" },
{ entry = 43711,  name = "I wish I had my father back..." },
{ entry = 43712,  name = "My prayers go out to my brothers and sisters who still suffer in the heart of Grim Batol. I WILL free them." },
{ entry = 43713,  name = "Boom. Now boom? I wish for a boom. Boom go! This coin must be broken, I wonder if it'll explode." },
{ entry = 43714,  name = "I wish I'd kept that coin..." },
{ entry = 43715,  name = "Just once -- that's all I ask for, just once -- let the lass ride with me... " },
{ entry = 43716,  name = "I wish the water in Northrend wasn't so cold, it makes me sleepy." },
{ entry = 43717,  name = "I hope that handsome nobleman Lord Prestor notices me! He's so dreamy!" },
{ entry = 43718,  name = "I wish to grow a glorious, bushy mustache someday." },
{ entry = 43719,  name = "Someday, I'm gonna be more powerful than all of these mages!" },
{ entry = 43720,  name = "I hope I can get transferred out of Stormwind eventually and see Cersei again. Nothing good ever happens in this city." },
{ entry = 43721,  name = "You mages refuse to provide me that which hastens the inevitable fate of two people in love, when only one is too naive to see it. I wish you all ruin." },
{ entry = 43722,  name = "Asto're da shan're. Turus Fulo Il'amare, A'Talah Adore. Isera'duna..." },
{ entry = 43723,  name = "I wish Captain Sanders would hurry up with my shipment of wine." },
{ entry = 43724,  name = "Ring? It's more like a necklace and a heavy one at that!" },
{ entry = 43725,  name = "Charred Glyph" },
{ entry = 43726,  name = "The crypt lord still carried it though he lost his royal title long ago when he entered the service of the Lich King." },
